import React, { useState } from "react";
import Person from "../../assets/images/Sign_In_icon/Person.png";
import Lock from "../../assets/images/Sign_In_icon/Lock.png";
import { Link } from "react-router-dom"; // Assuming you're using React Router
import "./Sign_In.css";

const SignIn = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);

  const handleSignIn = () => {
    console.log("Signing in...");
    console.log("Username:", username);
    console.log("Password:", password);
    console.log("Remember Me:", rememberMe);
    // Handle authentication here
  };

  return (
    <div className="signin-container">
      <div className="signin-box">
        <h2 className="signin-h2">Sign In</h2>
        <div className="input-with-icon">
          <img src={Person} alt="Person Icon" className="icon" />
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="Username"
          />
        </div>
        <div className="input-with-icon">
          <img src={Lock} alt="Lock Icon" className="icon" />
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Password"
          />
        </div>
        <div>
          <label>
            <input
              type="checkbox"
              checked={rememberMe}
              onChange={() => setRememberMe(!rememberMe)}
            />
            Remember Me
          </label>
          <Link to="/forgot_password">Forgot Password?</Link>
        </div>
        <div>
          <button onClick={handleSignIn}>Sign In</button>
        </div>
        <div>
          <Link to="/sign_up">Or Register Here!</Link>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
